description:
No Parking on the Dance Floor is Midnight Star's fourth and most successful album, containing the hit singles &quot;Freak-A-Zoid,&quot; &quot;Wet My Whistle,&quot; &quot;Electricity,&quot; and &quot;No Parking (On the Dance Floor).&quot; Also on the album is the classic quiet storm staple, &quot;Slow Jam.&quot;
Track listing

&quot;Electricity&quot;
&quot;Night Rider&quot;
&quot;Feels So Good&quot;
&quot;Wet My Whistle&quot;
&quot;No Parking (On the Dance Floor)&quot;
&quot;Freak-A-Zoid&quot;
&quot;Slow Jam&quot;
&quot;Playmates&quot;
